import  {StyleSheet} from "react-native";

const styles = StyleSheet.create({
    carContainer: {
        height: "100%",
        width: "100%",

    },

    titles: {
        marginTop: "25%",
        width: "100%",
        alignItems: "center",
    },

    title: {
        fontSize: 40,
        fontWeight: "bold",
        color: "black",
    },

    subtitle: {
        fontSize: 16,
        color: "#5c5e62",
    },

    image: {
        width: "100%",
        height: "100%",
        resizeMode: "cover",
        position: "absolute",
    },

});

export default styles;
